import React from "react";

export class List extends React.Component {
  render() {
    let ini = [];
    for (let i = 0; i < 10; i++) {
      ini.push(
        <li>
          <div className="one_list">
            <p style={{ backgroundColor: "red" }} className="list">
              1
            </p>
            <p className="list">Judul</p>
            <p className="list">Publisher</p>
          </div>
        </li>
      );
    }
    return <ul>{ini}</ul>;
  }
}
